import { Component, OnInit } from '@angular/core';
import { Camera, CameraOptions } from '@ionic-native/camera/ngx';
import { PhotoLibrary } from '@ionic-native/photo-library/ngx';
import { ImageResizer, ImageResizerOptions } from '@ionic-native/image-resizer/ngx';
import { dataService } from '../../api/data.service';

@Component({
  selector: 'app-almacen',
  templateUrl: './almacen.page.html',
  styleUrls: ['./almacen.page.scss'],
})
export class AlmacenPage implements OnInit {
  image: string = null;
  private imageSrc: string;
  dataa: any;

  constructor(private camera: Camera, private photoLibrary: PhotoLibrary, private api: dataService, private imageResizer: ImageResizer) { }

  ngOnInit() {

  }

  resize(uri){
    let options = {
      uri: uri,
      folderName: 'Protonet',
      quality: 90,
      width: 1280,
      height: 1280
     } as ImageResizerOptions;
     
     this.imageResizer
       .resize(options)
       .then((filePath: string) => console.log('FilePath', filePath))
       .catch(e => console.log(e));
  }

  getPicture(){
    let options: CameraOptions = {
      destinationType: this.camera.DestinationType.DATA_URL,
      targetWidth: 1000,
      targetHeight: 1000,
      quality: 100
    }

    this.camera.getPicture( options )
    .then(imageData => {
      this.image = `data:image/jpeg;base64,${imageData}`;
    })
    .catch(error =>{
      console.error( error );
    });
  }

  saveProduct(){
    let data = {
      nombre : "A",
      precio: 2000,
      cantidad: 20,
      id_tipo_producto: 1,
      oferta: 0,
      image: "data:image/jpeg;base64,"
    }
    console.log("Metodo")

    this.api.createProduct(data).subscribe(
      response => {console.log(response)},
      err => {console.log(err)}
    )
  }

  private openGallery (): void {
    let cameraOptions = {
      sourceType: this.camera.PictureSourceType.PHOTOLIBRARY,
      destinationType: this.camera.DestinationType.DATA_URL,      
      quality: 90,
      targetWidth: 1000,
      targetHeight: 1000,
      width: 220,
      height: 200,
      encodingType: this.camera.EncodingType.JPEG,    
      //mediaType: this.camera.MediaType.PICTURE,  
      correctOrientation: true
    }
  
    this.camera.getPicture(cameraOptions)
      .then(FILE_URI => {this.imageSrc = `data:image/jpeg;base64,${FILE_URI}`; this.resize(this.imageSrc), console.log(this.imageSrc)}, 
      err => console.log(err));   
  }

}

